import React from 'react'

import {ReactComponent as IconArrow} from './arrow.svg';
import {ReactComponent as IconBell} from './bell.svg';
import {ReactComponent as IconBolt} from './bolt.svg';
import {ReactComponent as IconCaret} from './caret.svg';
import {ReactComponent as IconChevron} from './chevron.svg';
import {ReactComponent as IconCog} from './cog.svg';
import {ReactComponent as IconMessenger} from './messenger.svg';
import {ReactComponent as IconPlus} from './plus.svg';


export default {
    IconArrow,
    IconBell,
    IconBolt,
    IconCaret,
    IconChevron,
    IconCog,
    IconMessenger,
    IconPlus
}
